Responsibilities:

Play a key role in a team of high-skilled developers and dev-ops;
Act as a mentor and a technical point of contact for the team;
Design and develop distributed, scalable, resilient, highly available services and systems with a focus on quality, security and cost efficiency;
Be involved in all the product development and delivery stages;
Research and prototype on various technologies useful for the project;
Keep in touch with the latest trends in the industry.
Qualifications

A minimum of 5 years of experience in object-oriented programming writing high-quality and well-documented code in Java – Spring / Spring Boot;
Proven experience designing, deploying and working with microservices in a cloud environment;
Knowledge of RESTful APIs, standard software design patterns, web application and web services architecture;
Ability to understand abstract requirements, define implementation steps and deliver results keeping the client’s needs in focus;
Adaptable to accepting challenges, learning new technologies and prototyping new ideas;
Organizational skills, attention to detail and a strong ability to communicate;
Proactive and independent;
Meticulous and focused on code quality.
It would be a plus if you have:

Knowledge of RDBMS and NoSQL databases;
Experience working with AWS services;
Experience with Docker and Kubernetes;

You will:

Responsible for the construction, operation and maintenance, optimization and security of the database system;
Responsible for establishing and improving database platform construction standards and specifications, writing database-related operation manuals and maintaining technical documents;
Responsible for the monitoring and tuning of high-availability clusters of PostgreSQL, MySQL, TiDB, redis and other databases; responsible for the formulation and implementation of database backup and recovery strategies to improve the quality of data services;
Assist in improving the automated operation and maintenance system of the database management team and improve the work efficiency of the DBA team;
Responsible for following up the daily database failure recovery, root cause analysis and subsequent improvement implementation;
Responsible for researching and learning cutting-edge database technologies, and combining new technologies with business system practices;
Complete other tasks assigned by the department;
 

What you'll need to succeed:

More than 3 years of working experience in database operation and maintenance management;
Able to independently complete database operation and maintenance management work including PostgreSQL and MySQL;
Correct working attitude, strong logical analysis ability, good at communication.

Requirements:

- Under university’s internship program / final year student / fresh graduate in Accountancy;
- Computer Literacy (Ms. Office - Excel & Word);
- Willing to learn, adaptive, and responsible;
- Able to do at least three (3) months internship period;
- Good personality, communicative, conscientious, willing to work in detail, and fast learner;
- Able work full time, 5 day a week, 08.00-17.00;
- Willing to be placed on Jl. HR Rasuna Said, Kuningan;

Job Description:

- Asist the Finance SPV to Check completeness of payment documents;
- Assist the SPV the preparation and analysis of financial statements, including balance sheets, income statements, and cash flow statements;
- Mapping the Account Payable, Prepaid Account, and Accrue;
